DELIMITER ;;
CREATE DEFINER=`anshu`@`localhost` PROCEDURE `sp_addaccountdetail`(
  in ACCOUNT_NUMBER varchar(50),
  in ACCOUNT_TYPE varchar(50),
  in AMMOUNT double(64,2),
  in STATUS varchar(50),
  in ACC_CREATEDBY varchar(50),
  in CUSTOMER_ID varchar(50),
  in ACC_CREATION_DATE varchar(50),
  in acc_updation_date varchar(50),
  in from_customerid varchar(50),
  in from_acc_number varchar(50),
 in deposited_date varchar(50),
  in acc_updated_by varchar(50),
  in ammount_type varchar(50),
  in amount_deposited double(64,2)
  )
begin
  insert into addaccountdetail
  values(ACCOUNT_NUMBER,
  ACCOUNT_TYPE,
   AMMOUNT,
   STATUS,
  ACC_CREATEDBY,
  CUSTOMER_ID,
  ACC_CREATION_DATE,
  acc_updation_date,
  from_customerid,
  from_acc_number,
  deposited_date,
  acc_updated_by,
  ammount_type,
  amount_deposited);
  end;;
