DELIMITER ;;
CREATE TRIGGER `trigger_trans_acc` AFTER UPDATE ON `addaccountdetail` FOR EACH ROW BEGIN
INSERT INTO acc_transaction(trans_id,ACCOUNT_NUMBER,ACCOUNT_TYPE,AMMOUNT,CUSTOMER_ID,from_customerid,from_acc_number,deposited_date,acc_updated_by,ammount_type,amount_deposited) 
values(NULL,NEW.ACCOUNT_NUMBER,NEW.ACCOUNT_TYPE,NEW.AMMOUNT,NEW.CUSTOMER_ID,NEW.from_customerid,NEW.from_acc_number,NEW.deposited_date,NEW.acc_updated_by,NEW.ammount_type,NEW.amount_deposited);
END;;;
DELIMITER ;
